import "./AboutContentStyles.css";
import React from "react";
import { Link } from "react-router-dom";

const AboutContent=()=>{
    return(
        <div className="about">
            <div className="left">
                <h1>Who am I</h1> 
                <p> I am a full stack developer</p>
                <Link to>contact</Link>
            </div>
            <div className="right"></div>

        </div>
    )
}
export default AboutContent;
